import './header.css';
import logo from './logo.jpg'
function Header(){
	return(
		<header className="row align-items-center">
		<div className="logo col-12 col-md-8 col-lg-9">
			<img src={logo} className="img-fluid" />
		</div>
		<div className="botonoes col-12 col-md-4 col-lg-3">
			<button type="button" className="btn btn-info"><i className="bi bi-power"></i>Ingresar</button>
			<button type="button" className="btn btn-outline-info"><i className="bi bi-person-plus-fill"></i>Registrarse</button>
			
		</div>
	</header>
		);
}
export default Header;
